import Countdown from 'react-countdown';
import Recommender from './Recommender';


function Home() {
    return (
        <div className="main">
            <div className="counter-and-cp-container">
                <Countdown date={Date.now() + 10000}/>
            </div>
            <Recommender/>
        </div>
    )
};

export default Home;
